import React, { ChangeEvent, useState } from "react";

import {
  Button,
  DropDown,
  ToggleBtnGroup,
} from "intelli-ui-components-library";
import style from "./server.module.scss";

function TabList() {
  const [activeTab, setActiveTab] = useState("tab1");

  const handleTab1 = () => {
    // update the state to tab1
    setActiveTab("tab1");
  };

  const handleTab2 = () => {
    // update the state to tab2
    setActiveTab("tab2");
  };

  const handleTab3 = () => {
    // update the state to tab1
    setActiveTab("tab3");
  };

  const handleTab4 = () => {
    // update the state to tab1
    setActiveTab("tab4");
  };

  const handleTab5 = () => {
    // update the state to tab1
    setActiveTab("tab5");
  };

  const handleTab6 = () => {
    // update the state to tab1
    setActiveTab("tab6");
  };

  const handleTab7 = () => {
    // update the state to tab1
    setActiveTab("tab7");
  };

  const handleTab8 = () => {
    // update the state to tab1
    setActiveTab("tab8");
  };

  const handleTab9 = () => {
    // update the state to tab1
    setActiveTab("tab9");
  };

  console.log(activeTab);

  const [values, setValues] = useState({});
  const [errors, setErrors] = useState({});

  const handleBlur = (e: ChangeEvent<HTMLInputElement>, key: string) => {
    const name = e.target.name;
    const tempValues = { ...values };
    const tempErrors = { ...errors };
    if (tempValues[key]) {
      tempErrors[key] = "";
    } else {
      tempErrors[key] = `${name} is required`;
    }
    setErrors({ ...tempErrors });
  };

  const handleChange = (e: ChangeEvent<HTMLInputElement>, key: string) => {
    const value = e.target.value;
    const tempValues = { ...values };
    tempValues[key] = value;
    setValues({ ...tempValues });
  };

  const handleClick = (e: any) => {
    alert("Button click");
  };

  const [value, setValue] = useState();

  const onChange = (e: any, label: string) => {
    setValue(e.label);
  };

  const [selectedTab, setSelectedTab] = useState("");
  const clickHandle = (e: any, val: any) => {
    setSelectedTab(val);
  };

  const handleSubmit = (arrayOfOperations: any) => {
    const tempValues = { ...values };
    for (const val in tempValues) {
      console.log(tempValues);
    }
    console.log(value);
    console.log(arrayOfOperations);
  };

  return (
    <div className={style["tablist-section"]}>
      <ToggleBtnGroup
        onToggle={clickHandle}
        selectedTab={selectedTab}
        shouldSelectByDefault={true}
        borderBottom={true}
        disabled
        className={style["toggle-btn"]}
        styleObj={{ bgColor: "#0086ff", color: "#0086ff" }}
      >
        <ToggleBtnGroup.Btn
          value="tab1"
          className={activeTab === "tab1" ? "active" : ""}
        >
          <div onClick={handleTab1}>URL</div>
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="tab2"
          className={activeTab === "tab2" ? "active" : ""}
        >
          <div onClick={handleTab2}>Description</div>
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="tab3"
          className={activeTab === "tab3" ? "active" : ""}
        >
          <div onClick={handleTab3}>Docs</div>
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="tab4"
          className={activeTab === "tab4" ? "active" : ""}
        >
          <div onClick={handleTab4}>Parameters</div>
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="tab5"
          className={activeTab === "tab5" ? "active" : ""}
        >
          <div onClick={handleTab5}>Request Body</div>
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="tab6"
          className={activeTab === "tab6" ? "active" : ""}
        >
          <div onClick={handleTab6}>Responses</div>
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="tab7"
          className={activeTab === "tab7" ? "active" : ""}
        >
          <div onClick={handleTab7}>Security</div>
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="tab8"
          className={activeTab === "tab8" ? "active" : ""}
        >
          <div onClick={handleTab8}>Links</div>
        </ToggleBtnGroup.Btn>
        <ToggleBtnGroup.Btn
          value="tab9"
          className={activeTab === "tab9" ? "active" : ""}
        >
          <div onClick={handleTab9}>Callbacks</div>
        </ToggleBtnGroup.Btn>
      </ToggleBtnGroup>

      <div className={style["tab-content"]}>
        {activeTab === "tab1" ? (
          <MainTab
            values={values}
            handleBlur={handleBlur}
            handleChange={handleChange}
            handleSubmit={handleSubmit}
          />
        ) : activeTab === "tab2" ? (
          <Description />
        ) : activeTab === "tab3" ? (
          <Docs />
        ) : activeTab === "tab4" ? (
          <Parameters />
        ) : activeTab === "tab5" ? (
          <RequestBody />
        ) : activeTab === "tab6" ? (
          <Responses />
        ) : activeTab === "tab7" ? (
          <Security />
        ) : activeTab === "tab8" ? (
          <Links />
        ) : activeTab === "tab9" ? (
          <Callbacks />
        ) : (
          ""
        )}
      </div>
      <Button className={style["btnAlignment"]} onClick={handleSubmit}>
        &#x2719; Add Operation
      </Button>
    </div>
  );
}

const Url = () => {
  return <div>Url</div>;
};
const Description = () => {
  return <div>Description</div>;
};

const Enums = () => {
  return <div>Enum List</div>;
};

export default TabList;
